/*
 * https://leetcode-cn.com/problems/maximum-number-of-occurrences-of-a-substring/
 * 给你一个字符串 s ，请你返回满足以下条件且出现次数最大的 任意 子串的出现次数：

    子串中不同字母的数目必须小于等于 maxLetters 。
    子串的长度必须大于等于 minSize 且小于等于 maxSize 。

 */
#include <string>
#include <iostream>
#include <unordered_map>
#include <map>
#include <unordered_set>
#include <vector>
#include <tuple>
#include "../util.h"

using namespace std;

class Solution {
public:
    unordered_set<char> s_count;
    bool check(string str, int32_t maxLetters){
        s_count.clear();
        for(const auto c:str){
            if(s_count.size() > maxLetters){
                return false;
            }
            s_count.insert(c);
        }
        if(s_count.size() > maxLetters){
            return false;
        }
        return true;
    }
    int maxFreq(string s, int maxLetters, int minSize, int maxSize) {
        int32_t res = 0;
        unordered_map<string, int32_t> word_map;
        unordered_set<string> invalid_set, valid_set;
        for(int32_t win_len = minSize; win_len <= maxSize; ++win_len){
            int32_t left = 0;  
            for(left = 0; left + win_len <= s.size(); ++left){
                string tmp_str = s.substr(left, win_len);
                if(valid_set.find(tmp_str) == valid_set.end() &&
                        (invalid_set.find(tmp_str) != invalid_set.end() || !check(tmp_str, maxLetters))){
                    invalid_set.insert(tmp_str);
                    continue;
                }
                valid_set.insert(tmp_str);
                ++word_map[tmp_str];
            }
        }
#if 0
        for(const auto& word:word_map){
            cout << word.first << ", " << word.second << endl;
        }
#endif
        for(const auto& iter:word_map){
            if(!check(iter.first, maxLetters)){
                continue;
            }
            res = iter.second > res ? iter.second : res;
        }

#if 0
        for(int32_t win_len = minSize; win_len <= maxSize; ++win_len){
            int32_t left = 0, right = 0;
            unordered_set<char> c_set;
            for(left = 0, right = 0; right < win_len; ++right){
                c_set.insert(s.at(right));
            }
        }
#endif
    
        return res;
    }
};

namespace optimize{
class Solution {
public:
    int maxFreq(string s, int maxLetters, int minSize, int maxSize) {
        int32_t res = 0;
        unordered_map<string, int32_t> res_map;
            unordered_set<char> c_s;
            string cur_str;
        for(int32_t left = 0; left < s.size(); ++left){
            c_s.clear();
            cur_str = "";
            for(int32_t right = left; right < s.size(); ++right){
                if(right - left + 1 > maxSize){
                    break;
                }
                c_s.insert(s.at(right));
                cur_str += s.at(right);
                if(right - left + 1 < minSize){
                    continue;
                }
                if(c_s.size() > maxLetters){
                    break;
                }
                ++res_map[cur_str];
                res = res > res_map[cur_str] ? res : res_map[cur_str];
            }
            
        }
        return res;
    }
};
}
    struct TupleHash
    {
        const size_t operator()(const std::tuple<int64_t, int64_t, string>& x)const
        {
#if 1
            uint64_t v = (uint64_t)get<0>(x);
            uint32_t hash_tmp = 0xabcdef;
            //hash_tmp = hash_tmp ^ v;
            hash_tmp = (uint64_t)get<0>(x) ^ (uint64_t)get<1>(x);
            hash_tmp = hash_tmp ^ hash<string>{}(get<2>(x));
            return (size_t)(hash_tmp % 1024001);
#endif
            //return get<0>(x) ^ get<1>(x);
        }
    };
    struct TupleComparer
    {
        bool operator()(const std::tuple<int64_t, int64_t, string> &x1, const std::tuple<int64_t, int64_t, string> &x2) const
        {
            return get<0>(x1) == get<0>(x2) && get<1>(x1) == get<1>(x2) && get<2>(x1) == get<2>(x2);
        }
    };

namespace optimize2{
class Solution {
public:
    const int64_t mod1_num  = 2222222223LL;
    const int64_t mod2_num  = 1111011111LL;

    int maxFreq(string s, int maxLetters, int minSize, int maxSize) {
        int32_t res = 0;
        unordered_map<tuple<int64_t, int64_t, string>, int32_t, TupleHash, TupleComparer> res_map;
#if 1
            unordered_set<char> c_s;
            string cur_str;
        for(int32_t left = 0; left < s.size(); ++left){
            c_s.clear();
            cur_str = "";
        int64_t mod1_val = 0, mod2_val = 0;
            for(int32_t right = left; right < s.size(); ++right){
                if(right - left + 1 > maxSize){
                    break;
                }
                c_s.insert(s.at(right));
                cur_str += s.at(right);
                mod1_val = (mod1_val * 26 + s.at(right) - 'a') % mod1_num;
                mod2_val = (mod2_val * 26 + s.at(right) - 'a') % mod2_num;
                if(right - left + 1 < minSize){
                    continue;
                }
                if(c_s.size() > maxLetters){
                    break;
                }
                ++res_map[make_tuple(mod1_val, mod2_val, cur_str)];
                res = res > res_map[make_tuple(mod1_val, mod2_val, cur_str)] ? res : res_map[make_tuple(mod1_val, mod2_val, cur_str)];
            }
            
        }
#endif
        return res;
    }
};
}

